import axios from 'axios';
import { baseUrlLocal } from '../shared/baseUrl';

class UserService {

    getUser(){
        return axios.get(baseUrlLocal + '/users');
    }

    postUser(){
        return axios.post(baseUrlLocal + '/users')
    }
}

export default  new UserService();
